import Layout from '../components/layout';

const About = () => {
    return(
        <Layout>
        <div>
            <h1> Sobre NextJS</h1>
            <p> Aplicacion para demostrar la adaptabilidad al framework y conceptos basicos </p>
        </div>
        </Layout>
    );
}

export default About;
